		function splitText(text) {
		    let result = [];
		    let current = "";
		    let insideComment = false;
		    let insideString = false;
		    let insideChar = false;
		    let insideHash = false; // Pridan√Ω flag na sledovanie # segmentu
		
		    for (let i = 0; i < text.length; i++) {
		        let char = text[i];
		        let nextChar = text[i + 1] || "";
		
		        // Ak u≈æ sme v sekcii po #
		        if (insideHash) {
		            current += char; // Zbierame v≈°etky znaky po #
		            continue;
		        }
		
		        if (!insideComment && char === "/" && nextChar === "*") {
		            insideComment = true;
		            if (current) result.push(current);
		            current = "/*";
		            i++;
		            continue;
		        }
		
		        if (insideComment && char === "*" && nextChar === "/") {
		            current += "*/";
		            result.push(current);
		            current = "";
		            insideComment = false;
		            i++;
		            continue;
		        }
		
		        if (insideComment) {
		            current += char;
		            continue;
		        }
		
		        if (!insideString && !insideChar && char === "'" && !insideChar) {
		            insideChar = true;
		            if (current) result.push(current);
		            current = char;
		            continue;
		        } else if (insideChar && char === "'") {
		            current += char;
		            result.push(current);
		            current = "";
		            insideChar = false;
		            continue;
		        }
		
		        if (!insideChar && char === '"' && !insideString) {
		            insideString = true;
		            if (current) result.push(current);
		            current = char;
		            continue;
		        } else if (insideString && char === '"') {
		            current += char;
		            result.push(current);
		            current = "";
		            insideString = false;
		            continue;
		        }
		
		        if (insideString || insideChar) {
		            current += char;
		        } else if (char === "#") {
		            if (current) result.push(current); // Ak pred # nieƒço bolo, prid√°me to
		            insideHash = true; // Zapneme flag pre sekciu po #
		            current = "#"; // Zaƒçneme nov√Ω segment po #
		            continue;
		        } else if (/\w/.test(char)) {
		            current += char;
		        } else {
		            if (current) result.push(current);
		            result.push(char);
		            current = "";
		        }
		    }
		
		    if (current) result.push(current);
		    return result;
		}
		
		function getColorForText(part) {
		    if (wordColors[part]) return wordColors[part];
		    if (part.startsWith("/*") && part.endsWith("*/")) return "gray";
		    if (part.startsWith('"') && part.endsWith('"')) return "yellow";
		    if (part.startsWith("'") && part.endsWith("'")) return "lime"; // Pre apostrofy
		    if (part.startsWith("#")) return "green"; // Zv√Ωrazni≈• v≈°etky znaky po #
		    return "white";
		}
		
		function createTextWithHighlightedWords(text) {
		    var textObjects = [];
		    var xPos = 0;
		    var parts = splitText(text);
		
		    for (var i = 0; i < parts.length; i++) {
		        var part = parts[i];
		        var color = getColorForText(part);
		
		        var txt = new createjs.Text(part, "14px Arial", color);
		        txt.x = xPos;
		        txt.y = 0;
		
		        textObjects.push(txt);
		        xPos += txt.getMeasuredWidth();
		    }
		
		    return textObjects;
		}
		
